import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

function Halo(props) {
  return(
    <div>
      <h1>Halo, apakabar {props.name}?</h1>
    </div>
  )
}

class Menyapa extends Component{
  render = (props) =>{
    return(
      <div>
        Halo, saya menyapa {this.props.name}
      </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      <Menyapa name="niko"/>
      <Halo name="Joni"/>
    </div>
  );
}

export default App;
